import Project from "./project"
import React, {Component} from "react"

const Column = (props) => {

    var projects = [1,1,1]

    return (
        <div className="column">
            <h1>{props.name}</h1>
            {this.projects.map(project =><Project/>)}
        </div>
    )

}



export default Column
